function fillMonthDates(selectEl, oldDate) {
  const dayNames = ["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"];
  const monthNames = [
    "January",
    "February",
    "March",
    "April",
    "May",
    "June",
    "July",
    "August",
    "September",
    "October",
    "November",
    "December"
  ];
  const { selectedYear, selectedMonth } = stateManager();
  if (selectedYear === null && selectedMonth === null) {
    const today = new Date();
    const year = today.getFullYear();
    const month = today.getMonth();
    const daysInMonth = new Date(year, month + 1, 0).getDate();
    for (let d = daysInMonth; d >= 1; d--) {
      const date = new Date(year, month, d);
      const day = date.getDate();
      const weekday = dayNames[date.getDay()];
      const monthName = monthNames[month];
      let label = `${day} ${monthName}, ${weekday}`;
      const diff = Math.floor((date - today) / (1e3 * 60 * 60 * 24));
      if (diff === -1)
        label = `Today, ${label}`;
      else if (diff === 0)
        label = `Tomorrow, ${label}`;
      else if (diff === 1)
        label = `The day after tomorrow, ${label}`;
      else if (diff === -2)
        label = `Yesterday, ${label}`;
      else if (diff === -3)
        label = `The day before yesterday, ${label}`;
      const value = `${year}-${String(month + 1).padStart(2, "0")}-${String(d).padStart(2, "0")}`;
      const option = selectEl.createEl("option", {
        text: label,
        attr: { value }
      });
      if (value === oldDate)
        option.selected = true;
      else if (diff === -1)
        option.selected = true;
    }
  } else {
    const convertMonth = new Date(`${selectedMonth} 1, ${selectedYear}`);
    const selectedMonthNumber = isNaN(convertMonth) ? null : convertMonth.getMonth();
    const today = new Date();
    const year = Number(selectedYear);
    const month = selectedMonthNumber;
    const daysInMonth = new Date(year, month + 1, 0).getDate();
    for (let d = daysInMonth; d >= 1; d--) {
      const date = new Date(year, month, d);
      const day = date.getDate();
      const weekday = dayNames[date.getDay()];
      const monthName = monthNames[month];
      let label = `${day} ${monthName}, ${weekday}`;
      const value = `${year}-${String(month + 1).padStart(2, "0")}-${String(d).padStart(2, "0")}`;
      const option = selectEl.createEl("option", {
        text: label,
        attr: { value }
      });
    }
  }
}
